import React, { useState} from 'react';
import './Content.css';

const Content = () => {

  const [title, setTitle] = useState(<h1>Empty Title</h1>);
  const [description, setDescription] = useState(<p>Empty Description</p>);
  const [ingredients, setIngredients] = useState(<ol><li>Empty List</li></ol>);
  const [steps, setSteps] = useState(<ol><li>Empty List</li></ol>);
  const [images, setImages] = useState(<div className="image-box"><img src="./placeholder.jpg" alt="" /></div>);

  const recipe = (
    <div className="content">
    <div className="box">
    <div className="recipe title">
      {title}
    </div>
    <div className="recipe image">
      <div className="arrow left"><span>{'<'}</span></div>
      {images}
      <div className="arrow right"><span>{'>'}</span></div>
    </div>
    <div className="recipe description">
      <h2>Description</h2>
      {description}
    </div>
    <div className="recipe ingredients">
      <h2>Ingredients</h2>
      {ingredients}
    </div>
    <div className="recipe steps">
      <h2>Steps</h2>
      {steps}
    </div>
  </div>
</div>
);

  return (
      {recipe}
    )
}

export default Content;
